import collections


class Trie:

    def __init__(self):
        self.children = {}
        self.is_word = False

    def add_word(self, word):
        iterator = self
        for char in word:
            if char not in iterator.children:
                iterator.children[char] = Trie()
            iterator = iterator.children[char]
        iterator.is_word = True

    def search_word(self, word, index, mismatch_count):
        for child, node in self.children.items():
            current_mismatch = 1 if child != word[index] else 0

            if mismatch_count + current_mismatch <= 1 and node.search_word(word, index + 1,
                                                                           mismatch_count + current_mismatch):
                return True
        return mismatch_count == 1 and not self.children


class Solution:
    """
    Revision 2 : This question was unsolved before. I solved it just now in the second revision attempt. I got the algo of hashing to solve the question almost immediately.
    There is however one important distinction to remember which I could not figure out because it's complicated.
    The hash generated could collide within a word itself. So a hash created for aaaaaa would collide with itself. We don't want this. So the order of the loops must be taken into consideration.
    """
    def differByOne(self, dict) -> bool:
        n = len(dict[0])
        hashes = [0] * len(dict)
        MOD = 10 ** 11 + 7

        def get_hash(word):
            hash = 0
            for j in range(n):
                hash = (26 * hash + (ord(word[j]) - ord('a'))) % MOD

            return hash

        for i in range(len(dict)):
            hashes[i] = get_hash(dict[i])

        base = 1
        for i in range(n - 1, -1, -1):
            cache = set()
            for j in range(len(dict)):
                converted_word_hash = (hashes[j] - base * (ord(dict[j][i]) - ord('a'))) % MOD
                if converted_word_hash in cache:
                    return True
                cache.add(converted_word_hash)
            base = 26 * base % MOD

        return False



