    """
    Attempt: Fired
    Accepted: 81%
    This question requires a bit of explanation.
    Attempt1: I used hash. I would store a word in the hash and for the subsequent words I would create new values. How? Create a new hash by replacing each character by a new character. This approach has two problems. Firstly, the hash function is an O(n) operation along the length of the word. So even though we are calculating hash, we are not saving time, because the very power of the hash is that it manipulates the string in O(1) which is not happening. Secondly, replacing each character although works and it requires O(26) which is not much, but an O(1) would be to just skip the character.
    
    The second and major problem with the approach that we solved this by is that it requires the use of MOD.
    Operationally this is a disaster. The creating of the string in hash should involve the same operations as the iteration of the string.
    During creating of the hash for the first time, we multiply the output with 26 and take MOD.
    We need to replicate the same operation during the iteration of the matching part.
    This is exactly why we run the loop backwards.  
    """
    def differByOne(self, dict) -> bool:
        MOD = 10 ** 11 + 7

        def getHash(word):
            hash = 0
            for i in range(len(word)):
                hash = (26 * hash + (ord(word[i]) - ord('a'))) % MOD
            return hash

        hashes = [0 for _ in range(len(dict))]
        for i in range(len(dict)):
            hashes[i] = getHash(dict[i])

        base = 1
        for i in range(len(dict[0]) - 1, -1, -1):
            cache = set()
            for j, word in enumerate(dict):
                current_hash = (hashes[j] - base * (ord(word[i]) - ord('a'))) % MOD
                if current_hash in cache:
                    return True
                cache.add(current_hash)
            base = 26 * base % MOD
        return False



